INSERT INTO `statements` (`id`, `exam_id`, `content`, `skill_id`, `text`, `score`, `level_id`, `status_id`, `photo_id`, `block_id`) VALUES
(79, NULL, 'Un amigo quiere saber cómo es tu vida en Madrid. Escríbele un correo breve en el que lo saludes le cuentes sobre tu rutina diaria y actividades de tiempo libre y finalmente te despidas. El texto debe tener entre 20 y 30 palabras.', 353, '', 20, 41, 1, NULL, 97),
(80, NULL, 'Tu amigo está interesado en mudarse a tu barrio. Escríbele un correo breve para contarle cómo es. Incluye un saludo, describe las características del barrio y finaliza con una despedida. El texto debe tener entre 20 y 30 palabras.', 353, '', 20, 41, 1, NULL, 97),
(81, NULL, 'Preséntate dando información personal como tu nombre, nacionalidad y edad. Habla también de tu trabajo o estudios y explica por qué estudias español. Elige tres de estas opciones y habla durante 2 o 3 minutos.', 354, '', 25, 41, 1, 292, 96),
(82, NULL, 'Preséntate incluyendo información personal como tu nombre, nacionalidad y edad. Además, puedes hablar sobre tu trabajo o estudios, explicar por qué estás aprendiendo español, o elegir otros temas similares. Selecciona tres de estas opciones y prepárate para hablar durante 2 o 3 minutos.', 354, '', 25, 41, 1, 293, 96),
(83, NULL, 'Lee este mensaje de correo electrónico. A continuación, responde a cinco preguntas sobre el texto. Elige la respuesta correcta (a, b, c, d):', 352, '¡Hola familia!: ¿Cómo estáis? Yo estoy muy contento porque el martes que viene empiezo a trabajar. Voy a trabajar en la biblioteca de mi universidad. Mis tareas son organizar los archivos y colocar los libros en las estanterías. Algunas veces también tengo que hablar con los estudiantes sobre los libros, pero no tengo que hacer fotocopias. Tengo un horario muy bueno: todas las tardes de 16:00 a 20:00, así que puedo estudiar por las mañanas. Una vez al mes tengo que trabajar los sábados. Las clases en la universidad son muy interesantes. Tengo clase todos los días, excepto los miércoles por la mañana, porque tengo prácticas en el laboratorio. Los fines de semana estudio con mis compañeros en la biblioteca de la universidad porque tenemos muchos exámenes. Por ejemplo, tengo un examen de lengua española el jueves. Bueno, ya sabéis las buenas noticias. Nos vemos el próximo mes porque en abril tenemos cuatro días de vacaciones. Os quiero mucho, Francisco', 10, 41, 1, NULL, 94),
(84, NULL, 'Lee este mensaje de correo electrónico. A continuación, responde a cinco preguntas sobre el texto. Elige la respuesta correcta (a, b, c, d):', 352, '¡Hola Steven! \n\n¿Qué tal estás? yo estoy contentísima en Salamanca, estoy viviendo una experiencia única. Vivo cerca de la Plaza Mayor con dos chicas de Suecia que estudian derecho. Por las mañanas, todos los días hago un curso intensivo de español en una escuela del centro. Después, mis compañeros y yo vamos a una pequeña cafetería donde almorzamos a la 14:00 todos juntos. Por la tarde, hacemos turismo. Hace dos días, visitamos Ávila, una pequeña ciudad que está cerca y de verdad, nunca he visto una muralla tan bien conservada. Es espectacular. Ahora me falta Segovia y algunos compañeros quieren pasar dos de días en Valladolid, seguro que vamos pronto. En un par de semanas, voy a Madrid para estar con mis padres que vienen una semana. Vamos a visitar juntos el Palacio Real y algunos museos. Mi madre planea ver una exposición sola en el Museo del Prado, pero mi padre y yo vamos a ir los dos al Reina Sofía porque no lo conocemos. Bueno, dicen que la obra de Picasso es increíble, ino hay duda! \nTe escribo pronto y te cuento todo. \nUn beso, \nRose', 15, 41, 1, NULL, 94),
(85, NULL, 'Usted quiere alquilar una casa para sus próximas vacaciones. Escriba un anuncio en el que debe decir: Cómo es la casa que busca, cuánto quiere pagar de alquiler. Número de palabras: entre 20 y 30.', 353, '', 20, 41, 1, NULL, 97),
(86, NULL, 'Prueba oral. Preséntese. Debe dar información personal como el nombre, la nacionalidad y la edad, y puede hablar de su trabajo o estudios, por qué estudia español, etc. Seleccione tres de las cinco opciones para hablar durante 2 o 3 minutos.', 354, '', 25, 41, 1, 321, 96),
(87, NULL, 'Lee este mensaje de correo electrónico. A continuación, responde a cinco preguntas sobre el texto. Elige la respuesta correcta (a, b, c, d):', 352, '¡Hola, Pablo!:\n¿Qué tal? Yo ahora estoy en Segovia, la ciudad de mis padres. Es una localidad que está muy cerca de Madrid. No es muy grande y además, es tranquila, pero en verano hay bastantes turistas porque es una ciudad Patrimonio de la Humanidad por la Unesco y eso atrae a más personas. Es una ciudad muy bonita y un buen lugar para vivir. Segovia tiene muchos monumentos antiguos, iglesias, una biblioteca y, lo más importante, un acueducto romano muy famoso. Por la calle principal de la ciudad, llegas a la Plaza Mayor y aquí está el teatro Juan Bravo y junto a él está la iglesia de San Miguel. Cerca de la plaza, al otro lado, está la magnífica catedral y enfrente, el palacio del Marqués del Arco. A los segovianos les gusta mucho venir a esta zona cuando hace buen tiempo porque hay terrazas al aire libre y se puede escuchar música popular bebiendo algo frío. Al otro lado de la ciudad está el Alcázar, que tiene unos jardines y unas vistas preciosas. En esta ciudad hay muchas tiendas para comprar cosas típicas. Esta tarde voy a comprarte algo dulce para ti.\nUn beso muy grande,\nMarina.', 15, 41, 1, NULL, 94),
(88, NULL, 'Usted tiene un amigo que quiere viajar a su ciudad de vacaciones. Escriba un correo electrónico explicando cómo es su ciudad y qué hay de interés turístico. En él debe: saludar, describir su ciudad y despedirse. El texto debe tener entre 20 y 30 palabras.', 353, '', 20, 41, 1, NULL, 97),
(89, NULL, 'Lee este mensaje de correo electrónico. A continuación, responde a cinco preguntas sobre el texto. Elige la respuesta correcta (a, b, c, d):', 352, 'Hola Marta:\nMe encanta mi vida en Barcelona. Estoy muy contenta en esta ciudad. Creo que es una ciudad muy especial porque es moderna, bonita y, además, la gente es muy simpática. Aquí llevo una vida muy ocupada. Me levanto a las ocho, me ducho y desayuno un café o un zumo de naranja con galletas. ¿Sabes?, no sé si en Madrid es igual pero aquí la gente normalmente desayuna dos veces. A media mañana comen tortilla de patatas con un café con leche o un café con un bocadillo de jamón y después, para almorzar, toman algo rápido en un bar o en una cafetería.\nDe lunes a viernes tengo curso de español por las mañanas y por tres días por las tardes tengo\nclases de flamenco.\nAntes de cenar, normalmente, voy al cine o a un museo para conocer un poco más la cultura. Los jóvenes españoles son muy abiertos y es fácil hacer amigos. He conocido a dos chicas de Valencia que están estudiando en mi universidad y a veces quedamos para tomar algo juntas. Me ayudan con mi español y siempre me corrigen, y eso me encanta porque estoy aprendiendo mucho.\nY tú, ¿cómo estás? ¿Vas a venir a por fin a visitarme? ¿antes de octubre?\nUn beso,\nAriadna.', 15, 41, 1, NULL, 94),
(90, NULL, 'Preséntese. Debe dar información personal como el nombre, la nacionalidad y la edad, y puede hablar de su trabajo o estudios, por qué estudia español, etc. Seleccione tres de las cuatro opciones para hablar durante 2 o 3 minutos.', 354, '', 25, 41, 1, 331, 96),
(91, NULL, 'Selecciona tres de las cinco opciones siguientes y habla sobre ellas durante 2 o 3 minutos. Usa frases simples y vocabulario básico.', 354, '', 25, 41, 1, 332, 96),
(92, NULL, 'Selecciona tres de las cinco opciones siguientes y habla sobre ellas durante 2 o 3 minutos. Usa frases simples y vocabulario básico.', 354, '', 25, 41, 1, 333, 96),
(93, NULL, 'Selecciona tres de las cinco opciones siguientes y habla sobre ellas durante 2 o 3 minutos. Usa frases simples y vocabulario básico.', 354, '', 25, 41, 1, 334, 96),
(94, NULL, 'Quieres organizar un evento social. Escribe un plan en el que debe incluir:\n- Qué tipo de evento quieres realizar.\n- Qué actividades vas a incluir.\n- Cómo se pueden inscribir los interesados.\nEl texto debe tener entre 20 y 30 palabras.', 353, '', 20, 41, 1, NULL, 97),
(95, NULL, 'Tienes que organizar una actividad al aire libre. Vas a comprar al supermercado. Escribe una lista donde debes incluir:\n- Alimentos para preparar: aperitivos, plato principal y postre.\n- Bebidas refrescantes (sin alcohol).\nEl texto debe tener entre 20 y 30 palabras.', 353, '', 20, 41, 1, NULL, 97),
(96, NULL, 'Quieres recomendar a una persona que conoces para trabajar en un proyecto de equipo en tu empresa. Escribe una nota breve de recomendación, debe incluir:\n- ¿Cómo es la persona? (Descripción física y de carácter).\n- ¿Por qué recomiendas a esta persona?\nEl texto debe tener entre 20 y 30 palabras.', 353, '', 20, 41, 1, NULL, 97),
(97, NULL, 'Lee esta carta. A continuación responde las cinco preguntas sobre el texto. Elige la respuesta correcta: a), b), c) o d). Marque las opciones elegidas en la Hoja de respuestas.', 352, 'Querido Pedro: \n¿Cómo estás? Yo, desde el lunes pasado, vivo en un pueblo en el campo. Te escribo una carta y no un correo electrónico porque aquí no hay Internet y no puedo usar mi ordenador portátil. Tampoco puedo usar mi teléfono móvil porque no tengo dinero en la tarjeta, pero el fin de semana vamos a ir a casa de unos amigos en otro pueblo y ellos si tienen conexión a Internet. Desde allí, voy a enviarte algunas fotos y podemos chatear un rato. \nEste pueblo es diferente, parece que vivo en el pasado porque no hay muchos medios de comunicación. Por supuesto que todos tienen televisión, pero no hay teléfono fijo en todas las casas, solo en el bar del pueblo. Lo que más me gusta es que la vida es muy tranquila. El caballo y la bicicleta son los únicos transportes. No hay contaminación, ni ruido, ni tráfico. \nLos lunes compro el periódico y leo las noticias. El periódico es el único medio de información que tengo aquí. \nBueno, el fin de semana chateamos y te cuento más cosas. \nUn abrazo, \nCamila', 15, 41, 1, NULL, 94),
(98, NULL, 'Lee este correo electrónico. A continuación responde las cinco preguntas sobre el texto. Elige la respuesta correcta: a), b), c) o d).', 352, 'Lola: \n¿Qué hacemos este fin de semana? Hay muchas cosas interesantes, por ejemplo, ya podemos ir a ver la nueva película de Pedro Almodóvar. Se llama Los abrazos rotos y dicen que está muy bien. La actriz principal es Penélope Cruz. Hay varios cines donde podemos verla: Renoir Princesa, Acteón e Ideal. También quiero ver la última película de Clint Eastwood, pero ahora no me acuerdo de cómo se llama. Lo podemos mirar en Internet y comprar las entradas on-line. Otra opción es ir a ver una obra de teatro, pero el teatro es bastante caro y hay que reservar antes. \n¿Sabes? La oreja de Van Gogh actúa en Madrid el fin de semana que viene. Creo que en la sala La Riviera. Ya tienen una nueva cantante y canta muy bien. El concierto es para presentar su último CD. \nLa semana que viene empieza el Festival Internacional de Fotografía, PhotoEspaña, y hay bastan- tes exposiciones de fotografía en muchas salas de la ciudad. En CaixaForum seguro que podemos ver alguna. \n¿Qué te parecen estos planes? Yo prefiero ver Los abrazos rotos, pero te llamo y hablamos para ver qué hacemos. \nErnesto', 15, 41, 1, NULL, 94),
(99, NULL, 'Lee este correo electrónico. A continuación responde las cinco preguntas sobre el texto. Elige la respuesta correcta: a), b), c) o d).', 352, 'Hola, Laura: \n¿Cómo estás? Yo estoy muy contenta porque mi novio Pablo y yo vamos a ir a Sevilla el próximo mes. Tenemos dos semanas de vacaciones. Es la primera vez que vamos allí, pero sé que tú conoces bien esa maravillosa ciudad y creo que puedes darme alguna información. ¿Conoces algún hotel con alojamiento y desayuno? No queremos gastar mucho dinero en el alojamiento. Preferimos hacer compras y excursiones. \n¿Cómo es el clima allí en primavera? Solo tengo una maleta gris y no es muy grande, así que quiero llevar cosas necesarias: blusas, pantalones, zapatillas y alguna falda. ¡Ah! También llevo un paraguas porque en primavera llueve, ¿no? \nEl próximo martes voy a la oficina de turismo para pedir un plano de la ciudad e información sobre los horarios de los lugares que queremos ver. Creo que en Sevilla hay una feria muy importante y queremos visitarla y hacer muchas fotos. \nBueno, te llamo mañana para vernos la semana que viene y hablar del viaje. \nUn beso, \nSilvina', 15, 41, 1, NULL, 94);
